description:
Apr 4, 2012: Knock Around | Holly Heart | Elise Graves  

PD sets her up and Elise Graves knocks her around. That is the forecast for Holly Heart today. I enjoy the look of determination she wears throughout the entire experience, like she has resolved to not cry through the worst of it. It does not matter if she lets any tears through or not, though. Some days PD and Elise are looking for a good bit of blubbering but others they are just looking for someone to torment, whether she screams, cries or just bears in it in silence. Unfortunately for Holly today is the latter. She may as well let it all out, because to them it hardly matters anyway.  

